const GlobalClasses = () => {
  return (
    <style jsx global>
      {`
        // CONTAINER
        .container {
          width: 96vw;
          max-width: 1000px;
        }

        // FONT
        .asap {
          font-family: "Asap", sans-serif;
        }

        // FLEXBOX
        .d-flex {
          display: flex;
        }
        .justify-center {
          justify-content: center;
        }
        .space-between {
          justify-content: space-between;
        }
        .space-around {
          justify-content: space-around;
        }
        .align-center {
          align-items: center;
        }
        .flex-column {
          flex-direction: column;
        }
        .flex-wrap {
          flex-wrap: wrap;
        }

        //POSITION
        .position-relative {
          position: relative;
        }
        .position-absolute {
          position: absolute;
        }
      `}
    </style>
  );
};

export default GlobalClasses;
